  input: '"TEXT","F3XA","C00167320","Q1.  The Committee conducted a full review of
    its 2004 checking account and FEC filings, and as a result has filed several amendments
    which have fixed the discrepancy between the beginning cash balance of this report
    and the ending balance of the Year End Report. Additionally, the totals listed
    on Lines 6(c), 7, 18(a), 18(c), 21(b), 21(c), 30(b), 30(c), 31, and 32, Column
    B of the Summary and Detailed Summary Pages have also been corrected as a result
    of the Committees 2004 review.  Q2.  The Committees calculations for Line 8 are
    now correct and cash-on-hand at the close of the reporting period now equals the
    closing calendar year-to-date cash-on-hand amount.  Q3.  The Committee disclosed
    on Line 17 an Other Receipt from the Democratic Congressional Campaign Committee
    (DCCC) on December 8, 2004 for $2035.32.  This receipt was for the sale of voter
    file data to the DCCC, where the Committee charged the usual and normal amount
    it would charge any entity regarding this matter.  In review of the DCCCs Year
    End Report, the disclosure of said disbursement to the CT Democratic State Central
    Committee appears on Schedule E as an Independent Expenditure on December 3, 2004.  Q4.  In
    review of the voter file consulting issue you reference in your letter of May
    27, 2005 and in consultation with our legal counsel, we have determined that these
    activities do not meet the definition of Federal Election Activity as these expenditures
    were for costs incurred in the building of our voter file, not for voter drive
    expenses."'
